import React, {Component} from 'react';
import './index.css';
import Nav from '../nav/nav';



class Header extends Component {
  constructor(props){
    super(props)

    this.state = {
      title: this.props.title

    }


  }
  render(){
    return(

      <header className="header">

      <h1> {this.state.title} </h1>

      <Nav/>
      </header>




    )
  }
}

export default Header;
